import './App.css';
import Login from './componentes/login';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1> My ponto</h1>
        <h3> Seu sistema de ponto</h3>
        <button name='Login' Login />
      </header>
    </div>
  );
}

export default App;
